import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {
	const CardListComponent = robots.forEach(function(el, i) {
		return <Card id={el.id} name={this.props.robots[i].name} email={this.props.robots[i].email}/>

	});
	return (
		<div>
			{ CardListComponent }
		</div>
	);

}

export default CardList;
